            text: >-
              At-Home Behandlingar 

              I en tid där socialt distansering kan påverka din möjlighet att
              komma till oss för behandling så kommer vi under en begränsad tid
              kunna erbjuda ett kit med produkter för en hemmabehandling som kan
              liknas med en härlig ansiktsbehandling hos oss på salongen.
              Samtidigt så fortsätter du stötta oss på salongen med ditt köp.
              Win-win? 

              Läs mer på Pipershudvard.com
